n      | Tl to zloty                |\r\n      | dollar to tl               |\r\n\r\n  @examples\r\n  Scenario Outline: configration ile arama testi\r\n\r\n    Then  Arama Kutusuna karsilastirma yapmak istedigi \"<istenilen karsilastirma>\" para birimlerini girer\r\n    Then  Para birimlerinin karsilastirmasini alir\r\n    Then Verilen degerlerin 21 den kucuk oldugunu dogrular\r\n    Then  Kullanici sayfayi kapatir\r\n    Examples:\r\n      | istenilen karsilastirma |\r\n      | aramaYapilacakBirim     |\r\n      | aramaYapilacakBirim1    |\r\n      | aramaYapilacakBirim2    |\r\n      | aramaYapilacakBirim3    |\r\n\r\n\r\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///C:/Users/Murat/Desktop/gitHubTeam108/Java/T-108_CucumberPracticee/src/test/resources/features/googleTest.feature","feature":{"location":{"line":2,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Google Arama Testi","description":"","children":[{"background":{"location":{"line":4,"column":3},"keyword":"Background","name":"ORTAK ADIMLAR","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"Kullanici google sayfasina gider","id":"41484b53-652d-4683-b4c5-ff4190cbbf38"},{"location":{"line":6,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Cokkies i google sayfasinda kabul eder","id":"b5d0b88b-d238-4364-a0f6-38a71fcce5c8"}],"id":"5078b422-77b4-440d-bad3-e1fff240908b"}},{"scenario":{"location":{"line":8,"column":3},"tags":[],"keyword":"Scenario","name":"Kullanici google sitesinde dolar to euro karsilastirmasi yapabilmeli","description":"","steps":[{"location":{"line":9,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Arama Kutusuna karsilastirma yapmak istedigi \"dollar to euro\" para birimlerini girer","id":"849e7d74-f951-4a1e-bc1f-961f80411ea4"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"Para birimlerinin karsilastirmasini alir"
